  //     },
  //     "NY": {
  //       fill: "#CC0000"
  //     }
  //   };
  // };
  
  render() 
  {
    return (
      <div className="App">
        <NavigationBar/>
        <h2>Oil Production By State from 1981 to 2016</h2>
  
        <PieChart/>
        <USAMap onClick={this.mapHandler}/>
  
        
      </div>
    );
  }
}

export default App;
